import logo from "./logo.svg";
import "./App.css";
import { Routes, Route, Outlet, NavLink } from 'react-router-dom';
import HomePage from "./Pages/HomePage/HomePage";

function App() {
  return (
    <div className="App">
      <Routes>

        <Route path="/" element={<HomePage />} />
      </Routes>
    </div>
  );
}

export default App;
